import React from 'react';
import { Player } from 'video-react';
import trailer from '../useless/Trailer.mp4';
import poster from '../useless/screenshots/7.png';

const Gallery = () => (
  <div className="container-fluid card shadow-sm bg-transparent bg-gradient">
    <div className="container-fluid row d-flex">
      <div className="container-fluid col-12 col-md-25 p-0 d-flex align-items-center justify-content-center">
        <Player
          playsInline
          poster={poster}
          src={trailer}
        />
      </div>
    </div>
  </div>
);

export default Gallery;
